import React from 'react';

const Frame7 = () => {
  return (
    <div
      style={{
        width: '1440px',
        height: '174px',
        background: 'rgba(28,38,76,1)',
        display: 'flex',
        alignItems: 'flex-start',
        justifyContent: 'center',
        boxSizing: 'border-box',
      }}
    >
      <div
        style={{
          width: '1069px',
          height: '72px',
          marginTop: '51px',
          marginLeft: 'auto',
          marginRight: 'auto',
          display: 'flex',
          flexDirection: 'row',
          gap: '124px',
          justifyContent: 'center',
          alignItems: 'center',
        }}
      >
        <img
          src="/frame113.png"
          alt="Frame 113"
          style={{ width: '1069px', height: '72px', objectFit: 'cover' }}
        />
      </div>
    </div>
  );
};

export default Frame7;
